/* eslint-disable jsx-a11y/anchor-is-valid */
import React from "react";
import Icons from "../assets/Icons";

const Dashboard = () => {
  return (
    <div className="nav-bar dp-f border-2px">
      <div className="keep-icon dp-f ">

        <div className="list-3 icon">
        <Icons focusable="false" name="List" size="24"/>

        </div>
        <div className="name-page">
        <a href="" className="dp-f">
        <img className="img " src="https://www.gstatic.com/images/branding/product/1x/keep_2020q4_48dp.png" srcset="https://www.gstatic.com/images/branding/product/1x/keep_2020q4_48dp.png 1x, https://www.gstatic.com/images/branding/product/2x/keep_2020q4_48dp.png 2x " alt="" aria-hidden="true" style={{width:'40px',height:'40px'}}></img>
        <span className="span "><h6>Keep</h6></span>
        </a>
</div>
      </div>

      <div className="search-div border-2px">
      <form action="" method="get">
      <button>
      </button>
      <div className="research">
      <input type="text"/></div>
      </form>
      </div>
      <div className="icons-end border-2px">work</div>
    </div>
  );
};
export default Dashboard;
